// Create a persistent chat session
let chatSession = model.startChat({
    generationConfig,
    history: [
        { role: "user", parts: [{ text: "hi who are you" }] },
        { role: "model", parts: [{ text: "I am Leo, and I have information about placed students in NEC." }] },
    ],
});

// API Endpoint to handle user queries
app.post('/ask', async (req, res) => {
    console.log("üì• Received request:", req.body);

    if (!req.body.input) {
        return res.status(400).json({ error: "Invalid input" });
    }

    try {
        const result = await chatSession.sendMessage(req.body.input);
        if (!result.response) throw new Error("Empty response from AI");

        console.log("ü§ñ AI Response:", result.response.text());
        res.json({ response: result.response.text() });
    } catch (error) {
        console.error("‚ùå Error:", error);
        res.status(500).json({ error: "Server error. Please try again." });
    }
});

